import React from "react";
import {listDecks} from "../utils/api/index";


async function DeckRender() {
    const decks = await listDecks();
    const deck = decks.decks;
    return deck;

}

function Home() {
    return (
        <div>
            <DeckRender/>
        </div>
    )

}


export default Home;
